# the following solution only works when height = width
height = length(matrix)

# edge middles
edge_middles_config = %{
  max_steps: height - 1,
  start_xys: [
    # bottom up
    {height - 1, floor(height / 2)},
    # top down
    {0, floor(height / 2)},
    # left to right
    {floor(height / 2), 0},
    # right to left
    {floor(height / 2), height - 1}
  ]
}

small_corners_config = %{
  max_steps: floor(height / 2) - 1,
  start_xys: [
    # bottom right
    {height - 1, height - 1},
    # bottom left
    {height - 1, 0},
    # top right
    {0, height - 1},
    # top left
    {0, 0}
  ]
}

big_corners_config = %{
  max_steps: height - 1 + floor(height / 2),
  start_xys: [
    # bottom right
    {height - 1, height - 1},
    # bottom left
    {height - 1, 0},
    # top right
    {0, height - 1},
    # top left
    {0, 0}
  ]
}

evens_config = %{
  max_steps: height - 1,
  start_xys: [
    # middle
    {floor(height / 2), floor(height / 2)}
  ]
}

odds_config = %{
  max_steps: height,
  start_xys: [
    # middle
    {floor(height / 2), floor(height / 2)}
  ]
}

[edge_middles_sum, small_corners_sum, big_corners_sum, evens_sum, odds_sum] =
  for config <- [
        edge_middles_config,
        small_corners_config,
        big_corners_config,
        evens_config,
        odds_config
      ] do
    for {start_x, start_y} <- config[:start_xys] do
      max_steps = config[:max_steps]

      reachable_xys =
        BFSCrawler.crawl(matrix, max_steps, [{start_x, start_y, 0}], [])
        |> Enum.filter(fn {x, y} ->
          rem(abs(x - start_x) + abs(y - start_y), 2) == rem(max_steps, 2)
        end)

      # IO.puts("")
      # IO.puts("Tiles count " <> Integer.to_string(length(reachable_xys)))
      # IO.puts(viz.(reachable_xys))
      length(reachable_xys)
    end
    |> Enum.sum()
  end

# dbg([edge_middles_sum, small_corners_sum, big_corners_sum, evens_sum, odds_sum])
# [23424, 3922, 27250, 7780, 7769]

# formula from README:
# for max steps = N * height + floor(height/2), we have total of: 1 edge middle sets + N small corners sets + (N-1) big corners sets + N^2 evens + (N-1)^2 odds

max_steps = 26_501_365
n = (max_steps - floor(height / 2)) |> div(height)
# dbg(n)
# 202300

ans =
  edge_middles_sum + n * small_corners_sum + (n - 1) * big_corners_sum + n ** 2 * evens_sum +
    (n - 1) ** 2 * odds_sum

dbg(ans)
